vailable filter options to be disabled?<br /><br /><strong>Greyed</strong> - Grey out the unavailable options.<br /><strong>Hidden</strong> - Hide the unavailable options.','34','80','2015-07-13 20:01:18','2015-07-10 11:28:15',NULL,'zen_cfg_select_option(array(\'Greyed\', \'Hidden\'),'),('594','Options Box Style','FILTER_OPTIONS_STYLE','Expand','Which style of box should be used when the maximum number of options has been reached?<br /><br /><strong>Scroll</strong> - Scroll box.<br /><strong>Expand</strong> - Expanding box with More/Less link.<br /><br /><strong>Note: This option is only applicatble with Link or Checkbox filter styles.</strong>','34','90','2015-07-13 19:56:23','2015-07-10 11:28:15',NULL,'zen_cfg_select_option(array(\'Scroll\', \'Expand\'),'),('595','Maximum Number of Options','FILTER_MAX_OPTIONS','9','What is the maximum number of options to be displayed before scroll bar/More link is visible?<br /><br /><strong>Note: This option is only applicatble with Link or Checkbox filter styles.</strong>','34','100','2015-07-11 19:26:18','2015-07-10 11:28:15',NULL,NULL),('596','Maximum Number of Price Ranges','FILTER_MAX_RANGES','5','What is the maximum number of price range groups?<br /><br /><strong>Note: This can be overridden by the Maximum Price Range parameter</strong>','34','110','2015-07-10 11:28:15','2015-07-10 11:28:15',NULL,NULL),('597','Minimum Price Range','FILTER_MIN_PRICE','10','What is the minimum gap in the price ranges?<br />Set as zero to deactivate.','34','120','2015-07-10 11:28:15','2015-07-10 11:28:15',NULL,NULL),('598','Maximum Price Range','FILTER_MAX_PRICE','25','What is the minimum gap in the price ranges?<br />Set as zero to deactivate.','34','130','2015-07-10 11:28:15','2015-07-10 11:28:15',NULL,NULL),('599','Include Options','FILTER_OPTIONS_INCLUDE','1,2,23','Enter the list of option IDs to be included in the filter, separated by commas (i.e. 1,2,3)<br />Only the option numbers listed here will appear in the filter.<br />Leave bla