ransparency if you MUST support older versions of Internet Explorer. However -png- is a MUCH BETTER format for transparency. Use -jpg- or -png- for larger images. -no_change- is old zen-cart behavior, use the same file extension for medium images as uploaded image-s.','4','1071','2015-07-10 11:50:44','2015-07-10 11:50:44',NULL,'zen_cfg_select_option(array(\'gif\',\'jpg\',\'png\',\'no_change\'),'),('610','IH medium images background','MEDIUM_IMAGE_BACKGROUND','255:255:255','If converted from an uploaded image with transparent areas, these areas become the specified color. Set to -transparent- to keep transparency.','4','1081','2015-07-10 11:50:44','2015-07-10 11:50:44',NULL,NULL),('611','IH medium images compression quality','MEDIUM_IMAGE_QUALITY','85','Specify the desired image quality for medium jpg images, decimal values ranging from 0 to 100. Higher is better quality and takes more space. Default is 85 which is ok unless you have very specific needs.','4','1091','2015-07-10 11:50:44','2015-07-10 11:50:44',NULL,NULL),('612','IH medium images watermark','WATERMARK_MEDIUM_IMAGES','no','Set to -yes-, if you want to show watermarked medium images instead of unmarked medium images.','4','1101','2015-07-10 11:50:44','2015-07-10 11:50:44',NULL,'zen_cfg_select_option(array(\'no\',\'yes\'),'),('613','IH large images filetype','LARGE_IMAGE_FILETYPE','no_change','Select one of -jpg-, -gif- or -png-. Older versions of Internet Explorer -v6.0 and older- will have issues displaying -png- images with transparent areas. You better stick to -gif- for transparency if you MUST support older versions of Internet Explorer. However -png- is a MUCH BETTER format for transparency. Use -jpg- or -png- for larger images. -no_change- is old zen-cart behavior, use the same file extension for large images as uploaded image-s.','4','1111','2015-07-10 11:50:44','2015-07-10 11:50:44',NULL,'zen_cfg_select_option(array(\'gif\',\'jpg\',\'png\',\'no_change\'),'),('614','IH large images background','LARGE_IMAGE_BACKGROUND','255:255:255','If converted from an uploaded image with transparent areas, these areas become the specified color. Set to -transparent- to keep transparency.','4','1121','2015-07-10 11:50:44','2015-07-10 11:50:44',NULL,NULL),('615','IH large images compression quality','LARGE_IMAGE_QUALITY','85','Specify the desired image quality for large jpg images, decimal values ranging from 0 to 100. Higher is better quality and takes more space. Default is 85 which is ok unless you have very specific needs.','4','1131','2015-07-10 11:50:44','2015-07-10 11:50:44',NULL,NULL),('616','IH large images watermark','WATERMARK_LARGE_IMAGES','no','Set to -yes-, if you want to show watermarked large images instead of unmarked large images.','4','1141','2015-07-10 11:50:44','2015-07-10 11:50:44',NULL,'zen_cfg_select_option(array(\'no\',\'yes\'),'),('617','IH large images maximum width','LARGE_IMAGE_MAX_WIDTH','750','Specify a maximum width for your large images. If width and height are empty or set to 0, no resizing of large images is done.','4','1151','2015-07-10 11:50:44','2015-07-10 11:50:44',NULL,NULL),('618','IH large images maximum height','LARGE_IMAGE_MAX_HEIGHT','550','Specify a maximum height for your large images. If width and height are empty or set to 0, no resizing of large images is done.','4','1161','2015-07-10 11:50:44','2015-07-10 11:50:44',NULL,NULL),('619','IH watermark gravity','WATERMARK_GRAVITY','Center','Select the position for the watermark relative to the image-s canvas. Default is <strong>Center</Strong>.','4','1171','2015-07-10 11:50:44','2015-07-10 11:50:44',NULL,'zen_cfg_select_option(array(\'Center\',\'NorthWest\',\'North\',\'NorthEast\',\'East\',\'SouthEast\',\'South\',\'SouthWest\',\'West\'),'),('620','IH version','IH_VERSION','4.3.2','IH Version is stored but not shown on configuration menus','0','10000','2015-07-10 11:50:44','2015-07-10 11:50:44',NULL,NULL),('621','Enable alternate URLs?','USU_ENABLED','true','This is a global setting and can be used to enable or disable this module completely.','35','1',NULL,'2015-07-10 11:50:47','','zen_cfg_select_option(array(\'true\', \'false\'),'),('622','Enable debug log?','USU_DEBUG','false','When enabled, additional debugging information is saved to log files.<br /><br />Enabling debugging may result in the creation of numerous log files and may adversely affect server performance. Only enable this if absolutely necessary!','35','2',NULL,'2015-07-10 11:50:47','','zen_cfg_select_option(array(\'true\', \'false\'),'),('623','Generate cPath parameters','USU_CPATH','auto','By default Zen Cart generates a cPath parameter for product pages. These are used to keep linked products in the correct category. In automatic mode the cPath will only be added if needed.','35','3',NULL,'2015-07-10 11:50:47','usu_check_cpath_option','usu_set_cpath_option('),('624','Alternate URLs end with','USU_END','.html','If you want your URLs to end with a certain suffix add one here. Common suffixes are \'.html\', \'.htm\'. Leave this field blank to have no suffix added to generated URLs.','35','4',NULL,'2015-07-10 11:50:47','',''),('625','Format of alternate URLs','USU_FORMAT','original','You can select from a list of commonly generated formats.<br /><b>Original:</b><br /><i>Categories:</i> category-name-c-34<br /><i>Products:</i> product-name-p-54<br /><br /><b>Category Parent:</b><br /><i>Categories:</i> parent-category-name-c-34<br /><i>Products:</i> parent-product-name-p-54','35','5',NULL,'2015-07-10 11:50:47','usu_check_url_format_option','usu_set_url_format_option('),('626','Display categories as directories','USU_CATEGORY_DIR','short','You can select from a list of commonly generated formats.<br /><b>Off:</b> disables displaying categories as directories<br /><br /><b>Short:</b> use the settings from \'Format of rewritten URLs\'<b>Full:</b> uses full category paths<br /><br />','35','6',NULL,'2015-07-10 11:50:47','usu_check_category_dir_option','usu_set_category_dir_option('),('627','Remove problematic characters','USU_REMOVE_CHARS','punctuation','This allows you remove certain problematic characters from the generated URLs.<br /><br /><i>non-alphanumerical:</i> removes all non-alphanumerical characters<br /><i>punctuation:</i> removes all punctuation characters','35','7',NULL,'2015-07-10 11:50:47','usu_check_remove_chars_option','usu_set_remove_chars_option('),('628','Enter PCRE filter rules','USU_FILTER_PCRE','','This setting uses PCRE rules to filter URLs.<br><br>This filter is run before character conversions and stripping of special characters. If you want a dash - in your URLS, use a single space. To escape a character in the regular expression use \\\\ instead of a single \\.<br /><br />The format <b>MUST</b> be in the form: <b>find1=>replace1,find2=>replace2</b>. ','35','8',NULL,'2015-07-10 11:50:47','',''),('629','Filter short words','USU_FILTER_SHORT_WORDS','0','This setting will filter words less than or equal to the value from the URL.','35','9',NULL,'2015-07-10 11:50:47','usu_check_short_words',''),('630','Limit alternate URLS to the following pages','USU_FILTER_PAGES','index, product_info, product_music_info, document_general_info, document_product_info, product_free_shipping_info, products_new, products_all, shopping_cart, featured_products, specials, contact_us, conditions, privacy, reviews, shippinginfo, faqs_all, site_map, gv_faq, discount_coupon, page, page_2, page_3, page_4','You can limit the pages which will be rewritten by specifying them here. If no pages are specified all pages will be rewritten. <br><br>The format is comma delimited and <b>MUST</b> be in the form: <b>page1,page2,page3</b> or <b>page1, page2, page3</b>','35','10',NULL,'2015-07-10 11:50:47','',''),('631','Choose URL Engine','USU_ENGINE','rewrite','Choose which URL Engine to use.','35','11',NULL,'2015-07-10 11:50:47','','zen_cfg_select_option(array(\'rewrite\'),'),('632','Enable automatic redirects?','USU_REDIRECT','false','This will activate the automatic redirect code and send 301 headers for old to new URLs.','35','12',NULL,'2015-07-10 11:50:47','','zen_cfg_select_option(array(\'true\', \'false\'),'),('633','Enable caches to save queries?','USU_CACHE_GLOBAL','true','This is a global setting and will turn off both memory and SQL caching of URLs completely.','35','13',NULL,'2015-07-10 11:50:47','usu_check_cache_options','usu_set_global_cache_option('),('634','Enable product cache?','USU_CACHE_PRODUCTS','true','This will turn off SQL caching for the products.','35','14',NULL,'2015-07-10 11:50:47','usu_check_cache_options','usu_set_cache_options(\'products\','),('635','Enable categories cache?','USU_CACHE_CATEGORIES','true','This will turn off SQL caching for the categories.','35','15',NULL,'2015-07-10 11:50:47','usu_check_cache_options','usu_set_cache_options(\'categories\','),('636','Enable manufacturers cache?','USU_CACHE_MANUFACTURERS','true','This will turn off SQL caching for the manufacturers.','35','16',NULL,'2015-07-10 11:50:47','usu_check_cache_options','usu_set_cache_options(\'manufacturers\','),('637','Enable ez pages cache?','USU_CACHE_EZ_PAGES','true','This will turn off SQL caching for ez pages.','35','17',NULL,'2015-07-10 11:50:47','usu_check_cache_options','usu_set_cache_options(\'ez_pages\','),('638','Reset URL Cache','USU_CACHE_RESET','false','This will reset the SQL cache data for URLs','35','18',NULL,'2015-07-10 11:50:47','usu_reset_cache_data','zen_cfg_select_option(array(\'true\', \'false\'),'),('639','Ultimate URLs Version','USU_VERSION','2.215','Indicates the currently installed version of Ultimate URLs.','35','0',NULL,'2015-07-10 11:50:47',NULL,'zen_cfg_select_option(array(\'2.215\'),'),('640','Number Of Testimonials to display in Testimonials Sidebox','MAX_DISPLAY_TESTIMONIALS_MANAGER_TITLES','1','Set the number of testimonials to display in the Latest Testimonials box.','36','1','2015-07-23 11:49:41','2015-07-23 11:46:55',NULL,NULL),('641','Testimonial Title Minimum Length','ENTRY