Menus, Chapter Selection, Subtitles (more languages).','','7'),('17','1','Speed Linked','Regional Code: 2 (Japan, Europe, Middle East, South Africa).\n<br />\nLanguages: English, Deutsch.\n<br />\nSubtitles: English, Deutsch, Spanish.\n<br />\nAudio: Dolby Surround 5.1.\n<br />\nPicture Format: 16:9 Wide-Screen.\n<br />\nLength: (approx) 112 minutes.\n<br />\nOther: Interactive Menus, Chapter Selection, Subtitles (more languages).','','2'),('18','1','Speed 2: Cruise Control','Regional Code: 2 (Japan, Europe, Middle East, South Africa).<br />\nLanguages: English, Deutsch.<br />\nSubtitles: English, Deutsch, Spanish.<br />\nAudio: Dolby Surround 5.1.<br />\nPicture Format: 16:9 Wide-Screen.<br />\nLength: (approx) 120 minutes.<br />\nOther: Interactive Menus, Chapter Selection, Subtitles (more languages).','','3'),('19','1','There\'s Something About Mary Linked','Regional Code: 2 (Japan, Europe, Middle East, South Africa).\n<br />\nLanguages: English, Deutsch.\n<br />\nSubtitles: English, Deutsch, Spanish.\n<br />\nAudio: Dolby Surround 5.1.\n<br />\nPicture Format: 16:9 Wide-Screen.\n<br />\nLength: (approx) 114 minutes.\n<br />\nOther: Interactive Menus, Chapter Selection, Subtitles (more languages).','','5'),('20','1','Beloved Linked','Regional Code: 2 (Japan, Europe, Middle East, South Africa).\n<br />\nLanguages: English, Deutsch.\n<br />\nSubtitles: English, Deutsch, Spanish.\n<br />\nAudio: Dolby Surround 5.1.\n<br />\nPicture Format: 16:9 Wide-Screen.\n<br />\nLength: (approx) 164 minutes.\n<br />\nOther: Interactive Menus, Chapter Selection, Subtitles (more languages).','','4'),('21','1','SWAT 3: Close Quarters Battle Linked','Windows 95/98<br /><br />211 in progress with shots fired. Officer down. Armed suspects with hostages. Respond Code 3! Los Angles, 2005, In the next seven days, representatives from every nation around the world will converge on Las Angles to witness the signing of the United Nations Nuclear Abolishment Treaty. The protection of these dignitaries falls on the shoulders of one organization, LAPD SWAT. As part of this elite tactical organization, you and your team have the weapons and all the training necessary to protect, to serve, and &quot;When needed&quot; to use deadly force to keep the peace. It takes more than weapons to make it through each mission. Your arsenal includes C2 charges, flashbangs, tactical grenades. opti-Wand mini-video cameras, and other devices critical to meeting your objectives and keeping your men free of injury. Uncompromised Duty, Honor and Valor!','www.swat3.com','18'),('22','1','Unreal Tournament Linked','From the creators of the best-selling Unreal, comes Unreal Tournament. A new kind of single player experience. A ruthless multiplayer revolution.<br /><br />This stand-alone game showcases completely new team-based gameplay, groundbreaking multi-faceted single player action or dynamic multi-player mayhem. It\'s a fight to the finish for the title of Unreal Grand Master in the gladiatorial arena. A single player experience like no other! Guide your team of \'bots\' (virtual teamates) against the hardest criminals in the galaxy for the ultimate title - the Unreal Grand Master.','www.unrealtournament.net','16'),('23','1','The Wheel Of Time Linked','The world in which The Wheel of Time takes place is lifted directly out of Jordan\'s pages; it\'s huge and consists of many different environments. How you navigate the world will depend largely on which game - single player or multipayer - you\'re playing. The single player experience, with a few exceptions, will see Elayna traversing the world mainly by foot (with a couple notable exceptions). In the multiplayer experience, your character will have more access to travel via Ter\'angreal, Portal Stones, and the Ways. However you move around, though, you\'ll quickly discover that means of locomotion can easily become the least of the your worries...<br /><br />During your travels, you quickly discover that four locations are crucial to your success in the game. Not surprisingly, these locations are the homes of The Wheel of Time\'s main characters. Some of these places are ripped directly from the pages of Jordan\'s books, made flesh with Legend\'s unparalleled pixel-pushing ways. Other places are specific to the game, conceived and executed with the intent of expanding this game world even further. Either way, they provide a backdrop for some of the most intense first person action and strategy you\'ll have this year.','www.wheeloftime.com','3'),('24','1','Disciples: Sacred Lands Linked','A new age is dawning...<br /><br />Enter the realm of the Sacred Lands, where the dawn of a New Age has set in motion the most momentous of wars. As the prophecies long foretold, four races now clash with swords and sorcery in a desperate bid to control the destiny of their gods. Take on the quest as a champion of the Empire, the Mountain Clans, the Legions of the Damned, or the Undead Hordes and test your faith in battles of brute force, spellbinding magic and acts of guile. Slay demons, vanquish giants and combat merciless forces of the dead and undead. But to ensure the salvation of your god, the hero within must evolve.<br /><br />The day of reckoning has come... and only the chosen will survive.','','5'),('25','1','Microsoft Internet Keyboard PS/2','The Internet Keyboard has 10 Hot Keys on a comfortable standard keyboard design that also includes a detachable palm rest. The Hot Keys allow you to browse the web, or check e-mail directly from your keyboard. The IntelliType Pro software also allows you to customize your hot keys - make the Internet Keyboard work the way you want it to!','','25'),('26','1','Microsoft IntelliMouse Explorer','Microsoft introduces its most advanced mouse, the IntelliMouse Explorer! IntelliMouse Explorer features a sleek design, an industrial-silver finish, a glowing red underside and taillight, creating a style and look unlike any other mouse. IntelliMouse Explorer combines the accuracy and reliability of Microsoft IntelliEye optical tracking technology, the convenience of two new customizable function buttons, the efficiency of the scrolling wheel and the comfort of expert ergonomic design. All these great features make this the best mouse for the PC!','www.microsoft.com/hardware/mouse/explorer.asp','13'),('27','1','Hewlett Packard LaserJet 1100Xi Linked','HP has always set the pace in laser printing technology. The new generation HP LaserJet 1100 series sets another impressive pace, delivering a stunning 8 pages per minute print speed. The 600 dpi print resolution with HP\'s Resolution Enhancement technology (REt) makes every document more professional.<br /><br />Enhanced print speed and laser quality results are just the beginning. With 2MB standard memory, HP LaserJet 1100xi users will be able to print increasingly complex pages. Memory can be increased to 18MB to tackle even more complex documents with ease. The HP LaserJet 1100xi supports key operating systems including Windows 3.1, 3.11, 95, 98, NT 4.0, OS/2 and DOS. Network compatibility available via the optional HP JetDirect External Print Servers.<br /><br />HP LaserJet 1100xi also features The Document Builder for the Web Era from Trellix Corp. (featuring software to create Web documents).','www.pandi.hp.com/pandi-db/prodinfo.main?product=laserjet1100','14'),('28','1','Gift Certificate $  5.00','Purchase a Gift Certificate today to share with your family, friends or business associates!','','4'),('29','1','Gift Certificate $ 10.00','Purchase a Gift Certificate today to share with your family, friends or business associates!','','2'),('30','1','Gift Certificate $ 25.00','Purchase a Gift Certificate today to share with your family, friends or business associates!','','2'),('31','1','Gift Certificate $ 50.00','Purchase a Gift Certificate today to share with your family, friends or business associates!','','2'),('32','1','Gift Certificate $100.00','Purchase a Gift Certificate today to share with your family, friends or business associates!','','2'),('34','1','A Bug\'s Life \"Multi Pak\" Special 2003 Collectors Edition','A Bug\'s Life \"Multi Pak\" Special 2003 Collectors Edition\n<br />\nRegional Code: 2 (Japan, Europe, Middle East, South Africa).\n<br />\nLanguages: English, Deutsch.\n<br />\nSubtitles: English, Deutsch, Spanish.\n<br />\nAudio: Dolby Digital 5.1 / Dolby Surround Stereo.\n<br />\nPicture Format: 16:9 Wide-Screen.\n<br />\nLength: (approx) 91 minutes.\n<br />\nOther: Interactive Menus, Chapter Selection, Subtitles (more languages).','www.abugslife.com','19'),('36','1','Hewlett Packard - by attributes SALE','The Product Price is set to 0.00\n<br /><br />\n\nThe Product Priced by Attributes is set to YES\n<br /><br />\n\nThe attribute prices are defined without the price prefix of +\n<br /><br />\n\nThe Display Price is made up of the lowest attribute price from each Option Name group.\n<br /><br />\n\nIf there had been a Product Price, this would have been added together to the lowest attributes price from each of the Option Name groups to make up the display price.\n<br /><br />\n\nThe price prefix of the + is not used as we are not \"adding\" to the display price.\n<br /><br />\n\nThe Colors attributes are set for the discount to be applied, their prices before the discount are:<br />\nWhite $499.99<br />\nBlack $519.00<br />\nBlue $539.00<br />','www.pandi.hp.com/pandi-db/prodinfo.main?product=laserjet1100','7'),('57','1','A Free Product - All','This is a free product where there are no prices at all.\n<br /><br />\n\nThe Always Free Shipping is also turned ON.\n<br /><br />\n\nIf this is bought separately, the Zen Cart Free Charge payment module will show if there is no charges on shipping.\n<br /><br />\n\nIf other products are purchased with a price or shipping charge, then the Zen Cart Free Charge payment module will not show and the shipping will be applied accordingly.','','3'),('101','1','TEST $120 Sale 10% Special off','Product is Priced by Attributes.\n<br /><br />\n\nAttribute Option Group: Color and Size are used for pricing by marking these as Included in Base Price.\n<br /><br />\n\nGift Options has everything marked included in base price also, but because None is set to $0.00 that groups lowest price is $0.00 so it is not affecting the Base Price.\n<br /><br />\n\nIf None was not part of this group and you did not want to include those prices, you would mark all of the Gift Option Attributes to NOT be included in the Base Price.\n<br /><br />\n\nProduct Product is $0.00\n<br /><br />\n\nSpecial does not exist\n<br /><br />\nSale Price is 10%\n<br /><br />\n\nAttributes:<br />\nColor:<br />\n- Red $100.00<br />\n- Orange $50.00<br />\n- Yellow $75\n<br /><br />\n\nSize:<br />\nSelect from Below:<br />\nSmall $50.00<br />\nMedium $75.00<br />\nLarge $100.00\n<br /><br />\n\nGift Options:<br />\n- Dated Collector\'s Tin $50.00<br />\n- Autographed Memorabila Card $75.00<br />\n- Wrapping $100.00\n<br /><br />\n\nNOTE: Select from below is defined as a Display Only Attribute and NOT to be included in the base price. \n<br /><br />\nThe Display Only means, the customer may NOT select this option value. If they do not selected another option value, then the product cannot be added to the shopping cart.\n<br /><br />\nThe NOT included in base price means, if this product were priced by attributes, it would not be include. The reason for this is so that the lowest price of this group will be the Small at $50.00 and not Select from Below at $0.00\n<br /><br />','','12'),('100','1','Hewlett Packard - by attributes SALE with Special','The Product Price is set to 0.00\n<br /><br />\n\nThe Product Priced by Attributes is set to YES\n<br /><br />\n\nThe attribute prices are defined without the price prefix of +\n<br /><br />\n\nThe Display Price is made up of the lowest attribute price from each Option Name group.\n<br /><br />\n\nIf there had been a Product Price, this would have been added together to the lowest attributes price from each of the Option Name groups to make up the display price.\n<br /><br />\n\nThe price prefix of the + is not used as we are not \"adding\" to the display price.\n<br /><br />\n\nThe Colors attributes are set for the discount to be applied, their prices before the discount are:<br />\nWhite $499.99<br />\nBlack $519.00<br />\nBlue $539.00<br />','www.pandi.hp.com/pandi-db/prodinfo.main?product=laserjet1100','7'),('39','1','A Free Product','This is a free product that is also on special.\n<br /><br />\n\nThis should show as having a price, special price but then be free.\n<br /><br />\n\nWhile this is a FREE product, this does have Shipping.','','7'),('40','1','A Call for Price Product','This is a Call for Price product that is also on special.\n<br />\n\nThis should show as having a price, special price but then be Call for Price. This means you cannot buy it.\n<br />','','8'),('41','1','A Call for Price Product SALE','This is a Call for Price product that is also on special and has a Sale price via Sale Maker.\n<br /><br />\n\nThis should show as having a price, special price but then be Call for Price. This means you cannot buy it.\n<br /><br />\n\nThe Add to Cart buttons automatically change to Call for Price, which is defined as: TEXT_CALL_FOR_PRICE\n<br /><br />\n\nThis link will take the customer to the Contact Us page.\n<br /><br />','','2'),('42','1','A Free Product - SALE','This is a free product that is also on special.\n<br />\n\nThis should show as having a price, special price but then be free.\n<br />','','6'),('43','1','A Free Product with Attributes','This is a free product that is also on special.\n<br /><br />\n\nThis should show as having a price, special price but then be free.\n<br /><br />\n\nAttributes can be added that can optionally be set to free or not free\n<br /><br />\n\nThe Color Red attribute is priced at $5.00 but marked as a Free Attribute when the Product is Free\n<br /><br />\n\nThe Size Medium attribute is priced at $1.00 but marked as a Free Attribute when Product is Free','','3'),('44','1','A Mixed OFF Product with Attributes','This product has attributes and a minimum qty and units.\n<br /><br />\n\nMixed is OFF this means you CANNOT mix attributes to make the minimums and units.\n<br /><br />\n\nThe Size Option Value: Select from Below ... is a Display Only Attribute. \n<br /><br />\n\nThis means that the product cannot be added to the Shopping Cart if that Option Value is selected. If it is still selected, then an error is triggered when the Add to Cart is pressed with a warning to the customer on what the error is.\n<br /><br />\n\nNo checkout is allowed when errors exist.','','16'),('46','1','A Mixed ON Product with Attributes','This product has attributes and a minimum qty and units.\n<br /><br />\n\nMixed is ON this means you CAN mix attributes to make the minimums and units.\n<br /><br />\n\nSelect from Below is a Display Only Attribute. This means that it cannot be added to the cart. If it is, then an error is triggered.\n<br /><br />\n\nNo checkout is allowed when errors exist.','','13'),('47','1','Gift Certificates by attributes','Priced by Attributes Gift Certificates.','','2'),('48','1','Test 1','This is a test product for copying and deleting attributes.\n<br /><br />\nAll of the images for this product are in the main /images directory and /large directory.\n<br /><br />\nThe main products_image is called 1_small.jpg\n<br /><br />\nThere are additional images for this product that will auto load located in /images called:<br />\n1_small_01.jpg<br />\n1_small_02.jpg<br />\n1_small_03.jpg<br />\n<br />\nThe large additional images are in /images/large called:<br />\n1_small_01_LRG.jpg<br />\n1_small_02_LRG.jpg<br />\n1_small_03_LRG.jpg<br />\n\n<br /><br />\n\nThe naming conventions for the additional images do not require that they be numeric. Using the numberic system helps establish the sort order of the images and how they will display.\n<br /><br />\n\nWhat is important is that all the additional images be located in the same directory and start with the same name: 1_small and end in the same extenion: .jpg\n<br /><br />\n\nThe additional large images need to be located in the /large directory and use the same name plus the Large image suffix, defined in the Admin ... Images ... in this case _LRG\n<br /><br />','','3'),('49','1','Test 2','This is a test product for copying and deleting attributes.\n<br /><br />\n\nThis was made using the Attributes Copy to Product in the new Admin ... Catalog ... Attributes Controller ... and copying the Attributes from the Test 1 product to Test 2.\n<br /><br />\n\nThis product does not have any additional images.\n<br /><br />\n\nIt does have a Large image located in /large\n<br /><br />\n\nThis uses the same name: 2_small plus the large image suffix _LRG plus the matching extension .jpg to give the new name: /images/large/2_small_LRG.jpg\n<br /><br />','','7'),('50','1','Test 3','This is a test product for copying and deleting attributes.\n<br /><br />\n\nThis was made using the Attributes Copy to Product in the new Admin ... Catalog ... Attributes Controller ... and copying the attributes from the Test 2 product to Test 3.\n<br /><br />\n\nThis product does not have any additional images.\n<br /><br />\n\nIt does NOT have a Large image located in /large\n<br /><br />\n\nThis means that when you click on the image for enlarge, unless the original image is larger than the small image settings you will see the same image in the popup.\n<br /><br />','','6'),('51','1','Free Ship & Payment Virtual weight 10','Free Shipping and Payment\n<br /><br />\n\nThe Price is set to 25.00 ... but what makes it Free is that this product has been marked as:\n<br />\nProduct is Free: Yes\n<br /><br />\n\nThis would allow the product to be listed with a price, but the actual charge is $0.00\n<br /><br />\n\nThe weight is set to 10 but could be set to 0. What really makes it truely Free Shipping is that it has been marked to be Always Free Shipping.\n<br /><br />\n\nAlways Free shipping is set to: Yes<br />\nThis will not charge for shipping, but requres a shipping address.\n<br /><br />\n\nBecause there is no shipping and the price is 0, the Zen Cart Free Charge comes up for the payment module and the other payment modules vanish.\n<br /><br />\n\nYou can change the text on the Zen Cart Free Charge module to read as you would prefer.\n<br /><br />\n\nNote: if you add products that incur a charge or shipping charge, then the Zen Cart Free Charge payment module will vanish and the regular payment modules will show.','','12'),('52','1','Free Ship & Payment Virtual','Product Price is set to 0\n<br /><br />\n\nPayment weight is set to 2 ...\n<br /><br />\n\nVirtual is ON ... this will skip shipping address\n<br /><br />','','5'),('53','1','Min and Units MIX','This product is purchased based on minimums and units.\n<br /><br />\n\nThe Min is set to 6 and the units is set to 3\n<br /><br />\n\nQuantity Minimums and Units are designed to more or less force the customer to make purchases of a Minimum Quantity ... and if need be, in Units.\n<br /><br />\n\nThis product can only be purchased if you buy at least 6 ... and after that in units of 3 ... 9, 12, 15, 18, etc.\n<br /><br />\n\nIf you do not purchase it in the right Quantity, you will not be able to checkout.\n<br /><br />\n\nWhen adding to the cart, the quantity box on the product_info page is \"smart\". It will adjust itself based on what is in the cart.\n<br /><br />\n\nThe Add to Cart buttons are also smart on New Products and Product Listing ... these also will adjust what is added to the cart.\n<br /><br />\n\nFor example: If there is 1 in the cart, the next use of Add to Cart will add 5 more to make the Minimum of 6. Add again and 3 more will be added to keep the Units correct.\n<br /><br />\n\nProduct Quantity Min/Unit Mix is for when a product has attributes.\n<br /><br />\n\nIf Mix is ON then a mix of attributes options may be used to make up the Quantity Minimum and Units. This means you can mix 1 blue, 3 silver and 2 green to get 6.\n<br /><br />\n\nIf the Mix is OFF then you may not mix 2 blue, 2 silver and 2 green to get 6.\n<br /><br />\n\nThis product has the Product Qty Min/Unit Mix set to ON','','5'),('54','1','Min and Units NOMIX','This product is purchased based on minimums and units.\n<br /><br />\n\nThe Min is set to 6 and the units is set to 3\n<br /><br />\n\nQuantity Minimums and Units are designed to more or less force the customer to make purchases of a Minimum Quantity ... and if need be, in Units.\n<br /><br />\n\nThis product can only be purchased if you buy at least 6 ... and after that in units of 3 ... 9, 12, 15, 18, etc.\n<br /><br />\n\nIf you do not purchase it in the right Quantity, you will not be able to checkout.\n<br /><br />\n\nWhen adding to the cart, the quantity box on the product_info page is \"smart\". It will adjust itself based on what is in the cart.\n<br /><br />\n\nThe Add to Cart buttons are also smart on New Products and Product Listing ... these also will adjust what is added to the cart.\n<br /><br />\n\nFor example: If there is 1 in the cart, the next use of Add to Cart will add 5 more to make the Minimum of 6. Add again and 3 more will be added to keep the Units correct.\n<br /><br />\n\nProduct Quantity Min/Unit Mix is for when a product has attributes.\n<br /><br />\n\nIf Mix is ON then a mix of attributes options may be used to make up the Quantity Minimum and Units. This means you can mix 1 blue, 3 silver and 2 green to g