o be added to the Shopping Cart per order.\n<br /><br />\n\nTwo methods are available to trigger the Hide Quantity Box.\n<br /><br />\n\nMethod 1: Set Quantity Box Shows to NO\n<br /><br />\n\nMethod 2: Set Qty Maximum to 1\n<br /><br />\n\nIn either case, you will only be able to add qty 1 to the shopping cart and the quantity box will not show.\n<br /><br />','','4'),('133','1','Multiple Downloads','<p>This product is set up to have multiple downloads.</p><p>The Product Price is $49.99</p><p>The attributes are setup with two Option Names, one for each download to allow for two downloads at the same time.</p><p>The first Download is listed under:</p><p>Option Name: Version<br />Option Value: Download Windows - English<br />Option Value: Download Windows - Spanish<br />Option Value: DownloadMAC - English<br /></p><p>The second Download is listed under:</p><p>Option Name: Documentation<br />Option Value: PDF - English<br />Option Value:MS Word- English</p>','','5'),('134','1','Per letter - required','<p>Product is priced by attribute</p><p>The Option Name Line 1 is setup as Text</p><p>The attribute is added to the product as Required</p><p>The pricing is $0.02 per letter</p><p>The Option Name Line2 is setup as Text</p><p>The attribute is added to the product as Required</p><p>The pricing is $0.02 per letter with 3 letters free</p><p>The Colors are set up as radio buttons and Red is the Default.</p>','','8'),('74','1','Hewlett Packard - by attributes with Special% no SALE','The Product Price is set to 0.00 Special is set to 20%\n<br /><br />\n\nThe Product Priced by Attributes is set to YES\n<br /><br />\n\nThe attribute prices are defined without the price prefix of +\n<br /><br />\n\nThe Display Price is made up of the lowest attribute price from each Option Name group.\n<br /><br />\n\nIf there had been a Product Price, this would have been added together to the lowest attributes price from each of the Option Name groups to make up the display price.\n<br /><br />\n\nThe price prefix of the + is not used as we are not \"adding\" to the display price.\n<br /><br />\n\nThe Colors attributes are, their prices before the Special discount is applied:<br />\nWhite $499.99<br />\nBlack $519.00<br />\nBlue $539.00\n<br /><br />\n\nThe Specials Price is a flat $100 discount. This $100 discount is applied to all attributes marked attributes_discounted Yes.','www.pandi.hp.com/pandi-db/prodinfo.main?product=laserjet1100','7'),('130','1','Special Product','<p>This is a Special product priced at $15 with a $10 Special</p><p>There are quantity discounts setup which will be discounted from the Special Price.</p><p>Discounts are added on the Products Price Manager.</p>','','6'),('131','1','Per word - required','<p>Product is priced by attribute</p><p>The Option Name Line 1 is setup as Text</p><p>The attribute is added to the product as Required</p><p>The pricing is $0.05 per word</p><p>The Option Name Line2 is setup as Text</p><p>The attribute is added to the product as Required</p><p>The pricing is $0.05 per word with 3 words Free</p><p>The Colors are set up as radio buttons and Red is the Default.</p>','','4'),('132','1','Golf Clubs','<p>Products Price is set to 0 and Products Weight is set to 1</p><p>This is marked Price by Attributes</p><p>This is priced by attribute at 14.45 per club with an added weight of 1 on the attributes.</p><p>This will make the shipping weight 1lb for the product plus 1lb for each attribute (club) added.</p><p>The attributes are sorted so the clubs read in order on the Product Info, Shopping Cart, Order, Email and Account History.</p>','','5'),('85','1','TEST $120 Special $90','Product is $120\n<br /><br />\n\nThere is a $90.00 or 25% Special and no sale on this product.\n<br /><br />\n\n\nAttributes:<br />\nColor:<br />\n- Red $100.00<br />\n- Orange $50.00<br />\n- Yellow $75\n<br /><br />\n\nSize:<br />\nSelect from Below:<br />\nSmall $50.00<br />\nMedium 